import React, { Component } from "react";
import LeftPanel from "./leftpanel";
import RightPanel from "./rightpanel";

class CenterPanel extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <div className="centerpanel">
          <LeftPanel />
          <RightPanel />
        </div>
      </React.Fragment>
    );
  }
}

export default CenterPanel;
